import React, { Component } from 'react';
import {Header, Container, Footer, Landing, Popular, Library} from './components/index';
// import { BrowserRouter, Route, Routes } from 'react-router-dom';

class App extends Component {
    render() {
        return(
            <>
                <Header />
                <Container>
                    <Landing />
                    <Popular />
                    <Library />
                </Container>
                <Footer />
            </>
        );
    }
}

export default App;
